import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awClickableTitleRenderFunction } from 'js/AwClickableTitleService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwClickableTitleService', () => import('js/AwClickableTitleService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awClickableTitleRenderFunction",
            "deps": "js/AwClickableTitleService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "cell-title-id": {
            "type": "string"
        },
        "prop": {
            "type": "field"
        },
        "source": {
            "type": "string"
        },
        "title": {
            "type": "string"
        },
        "vmo": {
            "type": "object"
        }
    },
    "_viewModelId": "AwClickableTitle",
    "_uniqueViewModelId": "AwClickableTitle",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awClickableTitleRenderFunction, undefined, ctxImportObj );

export default Component;
